import styles from "./app.module.css";
import { data } from "../../utils/data";
import AppHeader from "../app-header/app-header"

function App() {
  return (
    <body className={styles.app}>
      <div className={styles.page}>
        <AppHeader />
      </div>
    </body>
  );
}

export default App;
